  \"2015-10-02T14:01:04.866692\",\n\t\"name\": \"tiger-line-shapefile-2014-series-information-file-for-the-current-american-indian-ala\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \" The American Indian/Alaska Native/Native
  Hawaiian (AIANNH) Areas Shapefile includes the following legal entities: federally
  recognizedn               American Indian reservations and off-reservation trust
  land areas, state-recognized American Indian reservations, and Hawaiian home lands
  (HHLs). Then               statistical entities included are Alaska Native village
  statistical areas (ANVSAs), Oklahoma tribal statistical areas (OTSAs), tribal designatedn
  \              statistical areas (TDSAs), and state designated tribal statistical
  areas (SDTSAs). Joint use areas are also included in this shapefile refer to areasn
  \              that are administered jointly and/or claimed by two or more American
  Indian tribes. The Census Bureau designates both legal and statistical joint usen
  \              areas as unique geographic entities for the purpose of presenting
  statistical data. Note that tribal subdivisions and Alaska Native Regional Corporationsn
  \              (ANRCs) are additional types of American Indian/Alaska Native areas
  stored by the Census Bureau, but are displayed in separate shapefiles because of
  hown               they fall within the Census Bureau's geographic hierarchy. The
  State of Hawaii's Office of Hawaiian Home Lands provides the legal boundaries for
  then               HHLs. The boundaries for ANVSAs, OTSAs, and TDSAs were delineated
  for the 2010 Census through the Tribal Statistical Areas Program (TSAP) by participantsn
  \              from the federally recognized tribal governments. The Bureau of Indian
  Affairs (BIA) within the U.S. Department of the Interior (DOI) provides the listn
  \              of federally recognized tribes and only provides legal boundary information
  when the tribes need supporting records, if a boundary is based on treaty orn               another
  document that is historical or open to legal interpretation, or when another tribal,
  state, or local government challenges the depiction of an               reservation
  or off-reservation trust land. The boundaries for federally recognized American
  Indian reservations and off-reservation trust lands are as ofn               January
  1, 2013, as reported by the federally recognized tribal governments through the
  Census Bureau's Boundary and Annexation Survey (BAS). Then               boundaries
  for state-recognized American Indian reservations and for SDTSAs were delineated
  by a state governor-appointed liaisons for the 2010 Censusn               through
  the State American Indian Reservation Program and TSAP respectively.n            \",\n\t\"license_title\":
